  metadata?: any;
}

interface BottomPanelProps {
  selectedItem?: BottomPanelItem | null;
  millerColumnsRef?: React.RefObject<MillerColumnsRef>;
  currentColumnIndex?: number;
}

interface GridColumnConfig<T = GridItem> {
  id: string;
  header: string;
  accessorKey?: string;
  accessorFn?: (row: T) => any;
  cell?: (info: any) => React.ReactNode;
  size?: number;
  minSize?: number;
  maxSize?: number;
}

interface ChildItemsGridProps<T = GridItem> {
  data: T[];
  columns: GridColumnConfig<T>[];
  defaultSorting?: SortingState;
  className?: string;
  onRowClick?: (item: T, rowIndex: number) => void;
}

